    .tip()
    .attr('class', 'd3-tip')
    .offset([-10, 0])
    .html(function(d) {
      return `<span style='color:red'>${d.Unique}</span>`
    })

  svg
    .selectAll('.state')
    .data(states.features)
    .enter()
    .append('path')
    .attr('class', 'state')
    .attr('d', path)
    .attr('fill', 'grey')
    .attr('stroke', 'black')

  svg
    .selectAll('.state')
    .data(datapoints)
    .attr('class', 'state')
    .attr('fill', function(d) {
      return colorScale(d.Unique)
    })
